import { makeStyles } from '@material-ui/core'

export default makeStyles((theme) => ({
    center: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        margin: '2rem',
        color: '#F7F7FF',
    },
    grid: {
        flexGrow: 0,
        justifyContent: 'center',
        alignItems: 'center'
    },
    buttonTray: {
        display: 'flex',
        flexDirections: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        margin: 5,
        // top: 'auto',
        // right: 'auto',
        bottom: 20,
        // left: 'auto',
        position: 'fixed',
        zIndex: 999,
    },
    employeeFormContainer: {
        width: 'auto',
        height: 'auto',
        margin:'0 auto',
        position: 'absolute',
        left: '50%',
        top: '50%',
        marginLeft: '-250px',
        marginTop: '-250px',
    },
    button: {
        margin:10,
    },
}))
